 s table\n#Background: List of steps run before each of the scenarios\n#\"\"\" (Doc Strings)\n#| (Data Tables)\n#@ (Tags/Labels):To group Scenarios\n#<> (placeholder)\n#\"\"\n## (Comments)\n#Sample Feature Definition Template\n@register\nFeature: Validate Register page\n  @register_01\n  Scenario: launch to Homepage\n   \tGiven The user opens DS Algo portal link\n    When User Click on \"Get Started\"\n    Then Home Page Title should be \"NumpyNinja\" \n  #Scenario: User is on Homepage and click on Register\n    Given User is on Homepage\n    When The user clicks on register link\n    Then The user redirected to Registration page\n # @register_02\n  #Scenario: The user is presented with error message for empty fields below Username textbox\n   # Given The user opens Register Page\n   # When The user clicks \"Register\" button with all fields empty\n   # Then It should display an error message \"Please fill out this field.\" below Username textbox\n   @register_03\n  Scenario: The user is presented with error message for empty fields below Password textbox\n    Given The user opens Register Page\n    When The user clicks \"Register\" button after entering username with other fields empty\n      | username       |\n      | testing123 |\n    Then It should display an error message \"Please fill out this field.\" below Password textbox\n   @register_04\n  Scenario: The user is presented with error message for empty fields below confirm Password textbox\n    Given The user opens Register Page\n    When The user clicks \"Register\" button after entering \"username\" and \"password\" with Password Confirmation field empty\n      | username       | password     |\n      | testuser123 | testpassword |\n    Then It should display an error message \"Please fill out this field.\" below Password Confirmation textbox\n    @register_05\n  Scenario: The user is presented with error message for invalid username\n    Given The user opens Register Page\n    When The user enters a \"username\" with characters other than Letters, digits and \"@/./+/-/_\"\n      | username | password     | password confirmation |\n      | &**&**&  | testpassword | testpassword          |\n    Then It should display an error message \"password_mismatch:The two password fields didn’t match.\"\n     @register_06\n  Scenario: The user is presented with error message for password mismatch\n    Given The user opens Register Page\n    When The user clicks \"Register\" button after entering valid \"username\" and different passwords in \"password\" and \"password confirmation\" fields\n      | username       | password     | password confirmation |\n      | winterchamps | testpassword | testpassword1         |\n    Then It should display an error message \"password_mismatch:The two password fields didn’t match.\"\n    @register_07\n  Scenario: The user redirected to Homepage with valid details\n    Given The user opens Register Page\n    When The user enters a valid \"username\" and \"password\" and \"password confirmation\"\n      | username       | password  | password confirmation |\n      | winterchamps12 | Testwinter1! |  Testwinter1! |\n    Then The user should be redirected to Homepage with the message \"New Account Created. You are logged in as <username>\"\n  #   @register_08\n  #Scenario Outline: User on signin page and login with valid credentials\n  #  Given The user is on signin page\n   # When The user enter valid \"<username>\" and \"<password>\"\n    #Then click login button to verify\n\n    #Examples: \n     # | username       | password  |\n      #| winterchamps | Testwinter1! |","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/shrav/eclipse-workspace/Dsalgo_winterchamps/src/test/resources/AppFeatures/3_Register.feature","feature":{"location":{"line":20,"column":1},"tags":[{"location":{"line":19,"column":1},"name":"@register","id":"600be0d3-19ea-4cd9-8067-975f30729215"}],"language":"en","keyword":"Feature","name":" \n#And,But: To enumerate more Given,When,Then steps\n#Scenario Outline: List of steps for data-driven as an Examples and <placeholder>\n#Examples: Container for s table\n#Background: List of steps run before each of the scenarios\n#\"\"\" (Doc Strings)\n#| (Data Tables)\n#@ (Tags/Labels):To group Scenarios\n#<> (placeholder)\n#\"\"\n## (Comments)\n#Sample Feature Definition Template\n#@data_structure\nFeature: User launch dsalgo application and test Data Structure introduction page\n\tBackground: The user is logged in to DS Algo portal\n    Given The user is on Signin page of DS Algo portal\n    When The user enter valid \"winterchamps\" and \"Testwinter1!\"\n    And The user click on login button\n    Then The user logged in successfully\n    \n\t@DS_01\n  Scenario: The user is able to navigate to Data Structure introduction page\n    Given The user is on the \"home page\" after logged in\n    When The user clicks the \"Getting Started\" button in Data Structure Page introduction Panel\n    Then The user be directed to \"Data Structures-Introduction\" page\n       \n\t@DS_02\n  Scenario: The user is able to navigate to Time Complexity page\n    Given The user is on the \"Data Structures Introduction\" after logged in\n    When The user clicks Time Complexity link\n    Then The user is redirected to \"Time Complexity\" page\n  @DS_03\n  Scenario: The user is able to navigate to a page having an tryEditor from Time Complexity page\n    Given The user is on the \"Time Complexity\" after logged in\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a Run button to test\n  @DS_04\n  Scenario Outline: The user is able run code in tryEditor for Time Complexity page\n    Given The user is in a page having an tryEditor with a Run button to test\n    When The user enter valid python code in tryEditor from sheet \"<SheetName>\" and <RowNumber>\n    And The user clicks on run button\n    Then The user should be presented with Run result\n\n    Examples: \n      | SheetName  | RowNumber |\n      |pythonCode|0|\n      \n   @DS_05\n  Scenario Outline: The user is presented with error message for code with invalid syntax in tryEditor for Time Complexity page\n    Given The user is in a page having an tryEditor with a Run button to test\n    When The user enter python code with invalid syntax in tryEditor from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on run button\n    Then The user should be presented with error message\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         1 |\n    \n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/shrav/eclipse-workspace/Dsalgo_winterchamps/src/test/resources/AppFeatures/6_DataStructure.feature","feature":{"location":{"line":20,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"User launch dsalgo application and test Data Structure introduction page","description":"","children":[{"background":{"location":{"line":21,"column":2},"keyword":"Background","name":"The user is logged in to DS Algo portal","description":"","steps":[{"location":{"line":22,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is on Signin page of DS Algo portal","id":"c5d570df-8b34-4870-ad61-cfa9ddabfc79"},{"location":{"line":23,"column":5},"keyword":"When ","keywordType":"Action","text":"The user enter valid \"winterchamps\" and \"Testwinter1!\"","id":"4d4fbfb4-5717-4b02-8d20-b8f1c13d320b"},{"location":{"line":24,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"The user click on login button","id":"7ab6171e-fcf4-402c-888a-6da44fcdb0a7"},{"location":{"line":25,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"The user logged in successfully","id":"e76ba7d7-ea52-435d-a9f7-43171789a96e"}],"id":"6d422ac5-73fb-4e15-99ef-14faaeeb858b"}},{"scenario":{"location":{"line":28,"column":3},"tags":[{"location":{"line":27,"column":2} The user is able to navigate to a page having an tryEditor from Operations in Stack page\n    Given The user is on the \"Operations in Stack page\" after logged in\n    When The user clicks \"Try Here\" button in \"stack\" page\n    Then The user should be redirected to a page having an tryEditor with a Run button to test\n   @stack_05\n  Scenario Outline: The user is able to run code in tryEditor for Operations in Stack page\n    Given The user is in stack page having an tryEditor with a Run button to test\n    When The user gets input from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on Run button after Entering valid python code in stack tryEditor\n    Then The user should be presented with Run output\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         0 |\n\n  @stack_06\n  Scenario Outline: The user is able to get the error message for invalid syntax for Operations in Stack page\n    Given The user is in stack page having an tryEditor with a Run button to test\n    When The user gets invalid input from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on Run button after Entering invalid python code in stack tryEditor\n    Then The user should be presented with error output\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         1 |\n   @stack_07\n  Scenario: The user is able to navigate to \"Implementation\" Page\n    Given The user is on the \"Stack page\" after logged in\n    When The user clicks on the Implementation button\n    Then The user should be directed to Implementation Page\n   @stack_08\n  Scenario: The user is able to navigate to Implementation page having an tryEditor \n    Given The user is on the \"Stack Implementation page\" after logged in\n    When The user clicks \"Try Here\" button in \"stack Implementation\" page\n    Then The user should be redirected to a page having an tryEditor with a Run button to test\n   @stack_09\n  Scenario Outline: The user i
